import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import MyNavbar from './Navbar/navbar'
import MyJumbotron from './Jumbotron/jumbotron'

function App() {
  return (
    <div>
      <MyNavbar/>
      <MyJumbotron/>
    </div>
  );
}

export default App;
